import React from 'react'
import './Item.css'
function Item() {
  return (
    <div className='item'>
        <ima src={props.image} alt=""/>
        <p>{props.name}</p>
        <div className='item-price-new'>
            {props.new_price}
        </div>
        <div className='item-price-old'>
            {props.old_price}
        </div>
      
    </div>
  )
}

export default Item
